  return data
}

async function deleteAttendance(data){
  await StaffAttendance.deleteOne({staff_id : data.staff_id, attendance_date : moment.utc(data.attendance_date)})
}

export {
  saveStaffNewAttendance,
  updateStaffAttendanceStatus,
